description:
Tangled (2010) 
Alternatieve titel: Rapunzel 

Momenteel te zien in 93 bioscopen 

Verenigde Staten
Animatie / Fantasy
100 minuten

geregisseerd door Nathan Greno en Byron Howard
met de stemmen van Mandy Moore, Zachary Levi en Donna Murphy

Dutch:
Het verhaal over Prinses Rapunzel, die als baby is gestolen uit het paleis van haar ouders en door een heks genaamd Mother Gothel wordt opgesloten in een verborgen hoge toren, waar ze onmogelijk uit kan ontsnappen. Ze snakt naar avontuur in haar leven en droomt ervan de toren te verlaten om te zien waar de vreemde lichten, die ze elk jaar op haar verjaardag ziet, vandaan komen. Dat avontuur kan eindelijk beginnen als de knapste, maar ook beruchtste, crimineel van het koninkrijk, Flynn Rider, langs haar toren komt en naar boven klimt om zich te verstoppen. Ze maken samen de afspraak om uit de toren te ontsnappen en op zoek te gaan naar de lichten. Onderweg ontmoeten ze vele hilarische figuren en beleven ze een magisch avontuur.

English:
After receiving the healing powers from a magical flower, the baby Princess Rapunzel is kidnapped from the palace in the middle of the night by Mother Gothel. Mother Gothel knows that the flower's magical powers are now growing within the golden hair of Rapunzel, and to stay young, she must lock Rapunzel in her hidden tower. Rapunzel is now a teenager and her hair has grown to a length of 70-feet. The beautiful Rapunzel has been in the tower her entire life, and she is curious of the outside world. One day, the bandit Flynn Ryder scales the tower and is taken captive by Rapunzel. Rapunzel strikes a deal with the charming thief to act as her guide to travel to the place where the floating lights come from that she has seen every year on her birthday. Rapunzel is about to have the most exciting and magnificent journey of her life.

